import React, { Component } from "react";
import "./Grid.css";
class Grid extends Component {
  render() {
    return (
      <div id="GridBody">
        <table>
          <tbody>
            <tr>
              <td className="sq" onClick={PrintEle("row: 1\tcol: 1")}></td>
              <td className="sq" onClick={PrintEle("row: 1\tcol: 2")}></td>
            </tr>
            <tr>
              <td className="sq" onClick={PrintEle("row: 2\tcol: 1")}></td>
              <td className="sq" onClick={PrintEle("row: 2\tcol: 2")}></td>
            </tr>
          </tbody>
        </table>
      </div>
    );
  }
}

function PrintEle(ele) {
  console.log(ele);
}

export default Grid;
